#include <stdio.h>
#include <stdlib.h>
typedef unsigned long long ull;

ull fact(ull x) {
	if (x == 0) {
		return 1;
	}
	ull ans = 1;
	for (ull i = 2; i <= x; i++) {
		ans *= i;
	}
	return ans;
}

int main(void) {
	ull x;
	scanf_s("%llu", &x);
	printf("%llu", fact(x));
	return 0;
}

#include <stdio.h>
#include <stdlib.h>
typedef unsigned long long ull;

ull pow(ull b, ull e) {
	ull ans = 1;
	while (e) {
		if (e & 1) {
			ans = ans * b;
		}
		b *= b;
		e >>= 1;
	}
	return ans;
}

int main(void) {
	ull b, e;
	scanf_s("%llu %llu", &b, &e);
	printf("%llu", pow(b, e));
	return 0;
}

#include <stdio.h>

int isLeapYear(int year) {
    if (year % 4 == 0) {
        if (year % 100 == 0) {
            if (year % 400 == 0) {
                return 1;
            } else {
                return 0;
            }
        } else {
            return 1;
        }
    } else {
        return 0;
    }
}

int main() {
    int year;
    scanf("%d", &year);
    printf("%d\n", isLeapYear(year));
    return 0;
}

