class LRUCache {
    int capacity;
    list<pair<int, int>> lru;
public:
    LRUCache(int capacity) {
        this->capacity = capacity;
    }
    
    int get(int key) {
        if (lru.size() == 0) return -1;
        else
        {
          for (auto i : lru)
          {
            pair<int, int> tmp;
            if (i.first == key)
            {
              tmp = i;
              lru.remove(i);
              lru.push_back(tmp);
              return tmp.second;
            }
          }
        }
        return -1;
    }
    
    void put(int key, int value) {
        for (auto i : lru)
        {
          if (i.first == key)
          {
            lru.remove(i);
            lru.push_back(make_pair(key, value));
            return;
          }
        }
        // if key is not present
        if (lru.size() >= capacity)
        {
          lru.pop_front();
        }
        lru.push_back(make_pair(key, value));
    }
};

